  name: PageQualitativeResolution
  nameWithType: PageQualitativeResolution
  fullName: System.Printing.PageQualitativeResolution
  type: Enum
  summary: "Especifica a resolução de página como um valor não numérico qualitativo."
  remarks: "Você pode usar este tipo como uma alternativa ou suplemento, informando a resolução em pontos por polegada (dpi).       Essa enumeração é usada para fornecer valores para o <xref:System.Printing.PageResolution.QualitativeResolution%2A>propriedade.</xref:System.Printing.PageResolution.QualitativeResolution%2A> O <xref:System.Printing.PageResolution>classe, por sua vez, é usada para fornecer valores para o <xref:System.Printing.PrintCapabilities.PageResolutionCapability%2A>propriedade onde ela especifica várias resoluções que dá suporte a uma impressora, e o <xref:System.Printing.PrintTicket.PageResolution%2A>propriedade, onde ele instrui uma impressora resolução a ser usada.</xref:System.Printing.PrintTicket.PageResolution%2A> </xref:System.Printing.PrintCapabilities.PageResolutionCapability%2A> </xref:System.Printing.PageResolution>"
  syntax:
    content: public enum PageQualitativeResolution
  inheritance:
  - System.Enum
  platform:
  - net462
